script: |
  super -f text -I q11699.spq | sort > q11699.out

inputs:
  - name: q11699.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE ( + 69 NOT IN ( + col0 / - + col1, 20, + - CAST ( NULL AS INTEGER ) * - 21 ) ) OR - 67 IS NOT NULL;
  - name: tab2

outputs:
  - name: q11699.out
    data: |
      46	51	23
      64	77	40
      75	67	58
